);

CREATE TABLE sales_data (
  id INT PRIMARY KEY,
  product_name VARCHAR(255),
  region VARCHAR(50),
  sales_amount DECIMAL
);

CREATE TABLE products (
  product_id INT PRIMARY KEY,
  product_name VARCHAR(255),
  category VARCHAR(50),
  price DECIMAL
);

CREATE TABLE regions (
  region_id INT PRIMARY KEY,
  region_name VARCHAR(50),
  country VARCHAR(50)
);

CREATE TABLE region (
    region_id INT PRIMARY KEY,
    region_name TEXT
);

CREATE TABLE product (
    product_id INT PRIMARY KEY,
    product_name TEXT,
    category TEXT
);

CREATE TABLE top_products (
    product_id INT PRIMARY KEY,
    total_sales INT
);

CREATE TABLE regions_with_top_products (
    region_id INT,
    product_id INT
);
